import React from "react";

function Faq() {
  return (
	  <div className="flex min-h-screen bg-gradient-to-r from-indigo-500 to-indigo-700">
	  <div className="mx-auto text-center items-center text-2xl lg:text-4xl font-bold text-gray-700">FAQ</div>
	  	<div className="w-full mx-auto flex p-10 grid grid-cols-1 md:grid-cols-2">
	  		<div className="bg-white"></div>
	  		<div className="bg-yellow-500"></div>
	  	</div>
	  </div>
  );
}

export default Faq;
